import React from 'react';
import NavMenu from './NavMenu';
import '../Styles/General.css';

function Events(){
    return (
        <div className='page-setup'>
            <div className='page-content'>
                <h1 className='title'>EVENTS</h1>
                <hr />
                <br></br>
                <h2>WORKSHOT WITH SAMUEL BOLDUC</h2>
                <br></br>
                <p>
                Join photographer Samuel Bolduc for an inspiring workshop presentation that will ignite your creative vision. Discover the secrets behind Samuel's captivating photography style as he delves into research and exploration techniques to push artistic boundaries.

                Drawing inspiration from surrealism and "pop art," Samuel will guide you in adding a touch of fiction to reality, creating a new world through photography. This presentation is designed for photographers of all levels seeking fresh perspectives and creative growth.

                No equipment is required for this engaging session. Prepare to be inspired, challenged, and empowered to unlock your full creative potential. Don't miss this opportunity to learn from Samuel Bolduc, a visionary photographer renowned for his unique artistic approach.</p>
                <NavMenu />

            </div>

        </div>

    );
}

export default Events;
